    false,nt"url": null,nt"notes": "This dataset is a compilation of borehole
    temperature observations compiled by the Florida Geological Survey, published as
    a Web feature service, a web map service, an ESRI service, and as a set of Excel
    spreadsheets for the National Geothermal Data System. The downloadable spreadsheet
    contains 6 worksheets, including information about the template, notes related to
    revisions of the template, Resource provider information, the data, a field list
    (data mapping view) and a worksheet with vocabularies for use in populating the
    spreadsheet (data valid terms). Data from 393 wells are included. Fields in the
    data table include ObservationURI, WellName, APINo, HeaderURI, OtherID, OtherName,
    BoreholeName, Operator, LeaseOwner, LeaseNo, SpudDate, EndedDrillingDate, WellType,
    Status, CommodityOfInterest, StatusDate, Function, Production, Field, County, State,
    PLSS_Meridians, TWP, RGE, Section, SectionPart, Parcel, UTM_E, UTM_N, UTMDatumZone,
